import './style.css'
import ClosedEnvelope from "./components/ClosedEnvelope";
import closed from "./images/closed.png";
import openEnv from "";

function App(){
    function openEnvelope(){
    //     change src of image from open to closed
        document.getElementById("env").src={openEnv}
    //     then show the hearts?
    }

    return (
        <div id="background">
            <div className="message-body">
                Tap envelope to see a nice message
                <div>
                    <img id="env" src={closed} alt="envelope" width="400" onClick={openEnvelope}/>
                </div>
            </div>
        </div>
    );
}

export default App;
